import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Donor.css';

const Donor = () => {
  const [donors, setDonors] = useState([]);
  const [newDonor, setNewDonor] = useState({ name: '', bloodType: '', location: '' });
  const [updateDonor, setUpdateDonor] = useState({ id: '', name: '', bloodType: '', location: '' });
  const [error, setError] = useState('');

  useEffect(() => {
    fetchDonors();
  }, []);

  const fetchDonors = async () => {
    try {
      const response = await axios.get('/BloodDonation/donor/donordoctor');
      setDonors(response.data);
    } catch (error) {
      console.error('Error fetching donors:', error);
      setError('Error fetching donors');
    }
  };

  const handleCreateDonor = async () => {
    try {
      await axios.post('/BloodDonation/donor/donordoctor', newDonor);
      fetchDonors();
      setNewDonor({ name: '', bloodType: '', location: '' });
    } catch (error) {
      console.error('Error creating donor:', error);
      setError('Error creating donor');
    }
  };

  const handleUpdateDonor = async (id) => {
    try {
      await axios.put(`/BloodDonation/donor/donordoctor/${id}`, updateDonor);
      fetchDonors();
      setUpdateDonor({ id: '', name: '', bloodType: '', location: '' });
    } catch (error) {
      console.error('Error updating donor:', error);
      setError('Error updating donor');
    }
  };

  const handleDeleteDonor = async (id) => {
    try {
      await axios.delete(`/BloodDonation/donor/donordoctor/${id}`);
      fetchDonors();
    } catch (error) {
      console.error('Error deleting donor:', error);
      setError('Error deleting donor');
    }
  };

  return (
    <div className="donor-container">
      <h1>Donor Management</h1>
      {error && <p className="error-message">{error}</p>}

      <div className="donor-list">
        <h2>Donors</h2>
        {donors.map((donor) => (
          <div className="donor-card" key={donor.id}>
            <p>Name: {donor.name}</p>
            <p>Blood Type: {donor.bloodType}</p>
            <p>Location: {donor.location}</p>
            <button onClick={() => setUpdateDonor(donor)}>Update</button>
            <button onClick={() => handleDeleteDonor(donor.id)}>Delete</button>
          </div>
        ))}
      </div>

      {/* Add New Donor */}
      <div className="donor-form">
        <h2>Add New Donor</h2>
        <input
          type="text"
          placeholder="Name"
          value={newDonor.name}
          onChange={(e) => setNewDonor({ ...newDonor, name: e.target.value })}
        />
        <input
          type="text"
          placeholder="Blood Type"
          value={newDonor.bloodType}
          onChange={(e) => setNewDonor({ ...newDonor, bloodType: e.target.value })}
        />
        <input
          type="text"
          placeholder="Location"
          value={newDonor.location}
          onChange={(e) => setNewDonor({ ...newDonor, location: e.target.value })}
        />
        <button onClick={handleCreateDonor}>Add Donor</button>
      </div>

      {/* Update Donor */}
      {updateDonor.id && (
        <div className="donor-form">
          <h2>Update Donor</h2>
          <input
            type="text"
            placeholder="Name"
            value={updateDonor.name}
            onChange={(e) => setUpdateDonor({ ...updateDonor, name: e.target.value })}
          />
          <input
            type="text"
            placeholder="Blood Type"
            value={updateDonor.bloodType}
            onChange={(e) => setUpdateDonor({ ...updateDonor, bloodType: e.target.value })}
          />
          <input
            type="text"
            placeholder="Location"
            value={updateDonor.location}
            onChange={(e) => setUpdateDonor({ ...updateDonor, location: e.target.value })}
          />
          <button onClick={() => handleUpdateDonor(updateDonor.id)}>Update Donor</button>
        </div>
      )}
    </div>
  );
};

export default Donor;
